import React from 'react';
import axios from 'axios';

const services = () => {
    let todosList = []

    const getTodos = () => {
        axios.get(`https://github.com/gorillalogic/l-l-react-aws/tree/master/todo-aws`)
            .then(res => {
                todosList = res.data;
                return todosList
            })
    }


}

export default services;
